import React from "react";

function Projects() {
  return (
    <section id="projects" className="section">
      <h2>Projects</h2>
      <ul>
        <li>
          <strong>Portfolio Website</strong> - Built with React
        </li>
        <li>
          <strong>Todo App</strong> - With local storage
        </li>
        <li>
          <strong>Weather App</strong> - Using OpenWeather API
        </li>
      </ul>
    </section>
  );
}

export default Projects;
